import React, {Component} from 'react';
import Naves from '../components/Naves';
import 'bootstrap/dist/css/bootstrap.min.css';
import axios from 'axios';


class ElementMovie extends Component {
    state = {
        users: []
      }
    constructor(props) {
        super(props);
        this.state = {
          body: '',
          title: '',
          loading: true,
        };
      }

componentDidMount() {

    const { id } = this.props.match.params;
    const url = `https://swapi.co/api/films/${id}`;
    axios.get(url).then(response => response.data)
    .then((data) => {
        console.log(data);
      this.setState({ users: data.results })
     })
    console.log(data);
    }


  render() {
    return (
        <div className="mt-5 container">
          <div className="row">
          {this.state.users.map((user) => (
              <div className="elemto col-md-12 shadow p-3 mb-5 bg-white rounded animated fadeIn">
              <div className="col-md-12">
                  <h1>
                  <Naves ></Naves>
                      <MovieTitle nameTitle={user.title}></MovieTitle></h1>
              </div>
          </div>  
          ))}
        </div> 
    </div>
      );
    return (
        <div>
        <Naves></Naves>
     </div>
    );
  }
}

export default ElementMovie;
